INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(1, 'Animal', , 'Animals');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(2, 'LION', , 'The lion (Panthera leo) is a large cat of the genus Panthera native to Africa and India. It has a muscular, broad-chested body; short, rounded head; round ears; and a hairy tuft at the end of its tail. It is sexually dimorphic; adult male lions are larger than females and have a prominent mane. It is a social species, forming groups called prides. A lion\'s pride consists of a few adult males, related females, and cubs. Groups of female lions usually hunt together, preying mostly on large ungulates. The lion is an apex and keystone predator; although some lions scavenge when opportunities occur and have been known to hunt humans, lions typically do not actively seek out and prey on humans.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(3, 'TIGER', , 'The tiger (Panthera tigris) is the largest living cat species and a member of the genus Panthera. It is most recognisable for its dark vertical stripes on orange fur with a white underside. An apex predator, it primarily preys on ungulates, such as deer and wild boar. It is territorial and generally a solitary but social predator, requiring large contiguous areas of habitat to support its requirements for prey and rearing of its offspring. Tiger cubs stay with their mother for about two years and then become independent, leaving their mother\'s home range to establish their own.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(4, 'Red Panda', , 'The red panda (Ailurus fulgens), also known as the lesser panda, is a small mammal native to the eastern Himalayas and southwestern China. It has dense reddish-brown fur with a black belly and legs, white-lined ears, a mostly white muzzle and a ringed tail. Its head-to-body length is 51–63.5 cm (20.1–25.0 in) with a 28–48.5 cm (11.0–19.1 in) tail, and it weighs between 3.2 and 15 kg (7.1 and 33.1 lb). It is well adapted to climbing due to its flexible joints and curved semi-retractile claws.\r\n\r\nThe red panda was first formally described in 1825. The two currently recognised subspecies, the Himalayan and the Chinese red panda, genetically diverged about 250,000 years ago. The red panda\'s place on the evolutionary tree has been debated, but modern genetic evidence places it in close affinity with raccoons, weasels, and skunks. It is not closely related to the giant panda, which is a bear, though both possess elongated wrist bones or \"false thumbs\" used for grasping bamboo. The evolutionary lineage of the red panda (Ailuridae) stretches back around 25 to 18 million years ago, as indicated by extinct fossil relatives found in Eurasia and North America.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(5, 'Monkey', , 'Monkey is a common name that may refer to most mammals of the infraorder Simiiformes, also known as the simians. Traditionally, all animals in the group now known as simians are counted as monkeys except the apes, which constitutes an incomplete paraphyletic grouping; however, in the broader sense based on cladistics, apes (Hominoidea) are also included, making the terms monkeys and simians synonyms in regards to their scope.[citation needed][3]\r\n\r\nIn 1812, Geoffroy grouped the apes and the Cercopithecidae group of monkeys together and established the name Catarrhini, \"Old World monkeys\", (\"singes de l\'Ancien Monde\" in French).[3][4][5] The extant sister of the Catarrhini in the monkey (\"singes\") group is the Platyrrhini (New World monkeys).[3] Some nine million years before the divergence between the Cercopithecidae and the apes,[6] the Platyrrhini emerged within \"monkeys\" by migration to South America from Afro-Arabia (the Old World),[citation needed][7][8] likely by ocean.[9][10][better source needed] Apes are thus deep in the tree of extant and extinct monkeys, and any of the apes is distinctly closer related to the Cercopithecidae than the Platyrrhini are.\r\n\r\nMany monkey species are tree-dwelling (arboreal), although there are species that live primarily on the ground, such as baboons. Most species are mainly active during the day (diurnal). Monkeys are generally considered to be intelligent, especially the Old World monkeys.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(6, 'Bear', , 'Bears are carnivoran mammals of the family Ursidae (/ˈɜːrsɪdiː, -daɪ/). They are classified as caniforms, or doglike carnivorans. Although only eight species of bears are extant, they are widespread, appearing in a wide variety of habitats throughout the Northern Hemisphere and partially in the Southern Hemisphere. Bears are found on the continents of North America, South America, Europe, and Asia. Common characteristics of modern bears include large bodies with stocky legs, long snouts, small rounded ears, shaggy hair, plantigrade paws with five nonretractile claws, and short tails.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(7, 'Cat', , 'The cat (Felis catus) is a domestic species of small carnivorous mammal.[1][2] It is the only domesticated species in the family Felidae and is commonly referred to as the domestic cat or house cat to distinguish it from the wild members of the family.[4] Cats are commonly kept as house pets but can also be farm cats or feral cats; the feral cat ranges freely and avoids human contact.[5] Domestic cats are valued by humans for companionship and their ability to kill small rodents. About 60 cat breeds are recognized by various cat registries.[6]');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(8, 'Elephant', , 'Elephants are the largest existing land animals. Three living species are currently recognised: the African bush elephant, the African forest elephant, and the Asian elephant. They are the only surviving members of the family Elephantidae and the order Proboscidea. The order was formerly much more diverse during the Pleistocene, but most species became extinct during the Late Pleistocene epoch. Distinctive features of elephants include a long proboscis called a trunk, tusks, large ear flaps, pillar-like legs, and tough but sensitive skin. The trunk is used for breathing and is prehensile, bringing food and water to the mouth, and grasping objects. Tusks, which are derived from the incisor teeth, serve both as weapons and as tools for moving objects and digging. The large ear flaps assist in maintaining a constant body temperature as well as in communication. African elephants have larger ears and concave backs, whereas Asian elephants have smaller ears, and convex or level backs.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(9, 'Dog', , 'The dog (Canis familiaris[4][5] or Canis lupus familiaris[5]) is a domesticated descendant of the wolf. Also called the domestic dog, it is derived from extinct Pleistocene wolves,[6][7] and the modern wolf is the dog\'s nearest living relative.[8] Dogs were the first species to be domesticated[9][8] by hunter-gatherers over 15,000 years ago[7] before the development of agriculture.[1] Due to their long association with humans, dogs have expanded to a large number of domestic individuals[10] and gained the ability to thrive on a starch-rich diet that would be inadequate for other canids.[11]\r\n\r\nThe dog has been selectively bred over millennia for various behaviors, sensory capabilities, and physical attributes.[12] Dog breeds vary widely in shape, size, and color. They perform many roles for humans, such as hunting, herding, pulling loads, protection, assisting police and the military, companionship, therapy, and aiding disabled people. Over the millennia, dogs became uniquely adapted to human behavior, and the human–canine bond has been a topic of frequent study.[13] This influence on human society has given them the sobriquet of \"man\'s best friend\".[14]'),
(10, 'Fox', , 'Foxes are small to medium-sized, omnivorous mammals belonging to several genera of the family Canidae. They have a flattened skull, upright, triangular ears, a pointed, slightly upturned snout, and a long bushy tail (\"brush\").\r\n\r\nTwelve species belong to the monophyletic \"true fox\" group of genus Vulpes. Approximately another 25 current or extinct species are always or sometimes called foxes; these foxes are either part of the paraphyletic group of the South American foxes, or of the outlying group, which consists of the bat-eared fox, gray fox, and island fox.[1]');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(11, 'Wolf', , 'The wolf (Canis lupus;[b] pl: wolves), also known as the gray wolf or grey wolf, is a large canine native to Eurasia and North America. More than thirty subspecies of Canis lupus have been recognized, including the dog and dingo, though gray wolves, as popularly understood, only comprise naturally-occurring wild subspecies. The wolf is the largest extant member of the family Canidae, and is further distinguished from other Canis species by its less pointed ears and muzzle, as well as a shorter torso and a longer tail. The wolf is nonetheless related closely enough to smaller Canis species, such as the coyote and the golden jackal, to produce fertile hybrids with them. The wolf\'s fur is usually mottled white, brown, gray, and black, although subspecies in the arctic region may be nearly all white.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(12, 'Kangaroo', , 'Kangaroos are four marsupials from the family Macropodidae (macropods, meaning \"large foot\"). In common use the term is used to describe the largest species from this family, the red kangaroo, as well as the antilopine kangaroo, eastern grey kangaroo, and western grey kangaroo.[1] Kangaroos are indigenous to Australia and New Guinea. The Australian government estimates that 42.8 million kangaroos lived within the commercial harvest areas of Australia in 2019, down from 53.2 million in 2013.[2]');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(13, 'Panda', , 'The giant panda (Ailuropoda melanoleuca, sometimes panda bear or simply panda) is a bear species endemic to China.[4] It is characterised by its bold black-and-white coat and rotund body. The name \"giant panda\" is sometimes used to distinguish it from the red panda, a neighboring musteloid. Though it belongs to the order Carnivora, the giant panda is a folivore, with bamboo shoots and leaves making up more than 99% of its diet.[5] Giant pandas in the wild occasionally eat other grasses, wild tubers, or even meat in the form of birds, rodents, or carrion. In captivity, they may receive honey, eggs, fish, yams, shrub leaves, oranges, or bananas along with specially prepared food.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(20, 'Deer', , 'Deer or true deer are hoofed ruminant mammals forming the family Cervidae. The two main groups of deer are the Cervinae, including muntjac, elk (wapiti), red deer, and fallow deer; and the Capreolinae, including reindeer (caribou), white-tailed deer, roe deer, and moose. Male deer of all species (except the water deer), as well as female reindeer, grow and shed new antlers each year. In this, they differ from permanently horned antelope, which are part of a different family (Bovidae) within the same order of even-toed ungulates (Artiodactyla).\r\n\r\nThe musk deer (Moschidae) of Asia and chevrotains (Tragulidae) of tropical African and Asian forests are separate families that are also in the ruminant clade Ruminantia; they are not especially closely related to Cervidae.\r\n\r\nDeer appear in art from Paleolithic cave paintings onwards, and they have played a role in mythology, religion, and literature throughout history, as well as in heraldry, such as red deer that appear in the coat of arms of Åland.[2] Their economic importance includes the use of their meat as venison, their skins as soft, strong buckskin, and their antlers as handles for knives. Deer hunting has been a popular activity since the Middle Ages and remains a resource for many families today.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(14, 'Black Panther', , 'In 1788, Jean-Claude Delamétherie described a black leopard that was kept in the Tower of London and had been brought from Bengal.[1] In 1794, Friedrich Albrecht Anton Meyer proposed the scientific name Felis fusca for this cat, the Indian leopard (P. p. fusca).[2][3] In 1809, Georges Cuvier described a black leopard kept in the Ménagerie du Jardin des plantes that had been brought from Java. Cuvier proposed the name Felis melas, the Javan leopard (P. p. melas).[4][3] By the late 19th century, the occurrence of black and spotted leopard cubs in the same litter had been repeatedly recorded in India. Black leopards were thought to be more common in Travancore and in the hills of southern India than in other parts of the country.[5] Black leopards were also frequently encountered in southern Myanmar.[6] By 1929, the Natural History Museum, London had skins of black leopards collected in South Africa, Nepal, Assam and Kanara in India.[7] Black leopards were thought to be common on the Malay Peninsula and on Java.[8]');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(15, 'Jaguar', , 'The jaguar (Panthera onca) is a large cat species and the only living member of the genus Panthera native to the Americas. With a body length of up to 1.85 m (6 ft 1 in) and a weight of up to 158 kg (348 lb), it is the largest cat species in the Americas and the third largest in the world. Its distinctively marked coat features pale yellow to tan colored fur covered by spots that transition to rosettes on the sides, although a melanistic black coat appears in some individuals. The jaguar\'s powerful bite allows it to pierce the carapaces of turtles and tortoises, and to employ an unusual killing method: it bites directly through the skull of mammalian prey between the ears to deliver a fatal blow to the brain.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(16, 'Leopard', , 'The leopard (Panthera pardus) is one of the five living species in the genus Panthera. It occurs across a wide range in Africa and Asia and has adapted to a variety of habitats ranging from rainforest to arid and steppe habitats. It has relatively short legs and an elongated body with a large skull. Its fur is marked with rosettess, which provide camouflage as it stalks and ambushes its prey. It is an opportunistic predator, hunting a variety of species including ungulates and primates. It is solitary unless during the mating season and when raising cubs.\r\n\r\nIt is listed as Vulnerable on the IUCN Red List because leopard populations are threatened by habitat loss and fragmentation, and are declining in large parts of the global range. Leopards have had cultural roles in Ancient Greece, West Africa and modern Western culture. Leopard skins have been popular in fashion.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(17, 'Cheetah', , 'The cheetah (Acinonyx jubatus) is a large cat native to Africa and Southwest Asia (today restricted to central Iran). It is the fastest land animal, capable of running at 80 to 98 km/h (50 to 61 mph), as such has evolved specialized adaptations for speed, including a light build, long thin legs and a long tail. It typically reaches 67–94 cm (26–37 in) at the shoulder, and the head-and-body length is between 1.1 and 1.5 m (3 ft 7 in and 4 ft 11 in). Adults weigh between 21 and 72 kg (46 and 159 lb). Its head is small and rounded, with a short snout and black tear-like facial streaks. The coat is typically tawny to creamy white or pale buff and is mostly covered with evenly spaced, solid black spots. Four subspecies are recognised.\r\n\r\nThe cheetah lives in three main social groups: females and their cubs, male \"coalitions\", and solitary males. While females lead a nomadic life searching for prey in large home ranges, males are more sedentary and instead establish much smaller territories in areas with plentiful prey and access to females. The cheetah is active during the day, with peaks during dawn and dusk. It feeds on small- to medium-sized prey, mostly weighing under 40 kg (88 lb), and prefers medium-sized ungulates such as impala, springbok and Thomson\'s gazelles. The cheetah typically stalks its prey within 60–100 m (200–330 ft) before charging towards it, trips it during the chase and bites its throat to suffocate it to death. It breeds throughout the year. After a gestation of nearly three months, a litter of typically three or four cubs is born. Cheetah cubs are highly vulnerable to predation by other large carnivores such as hyenas and lions. They are weaned at around four months and are independent by around 20 months of age.');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(18, 'Quokka', , 'A quokka weighs 2.5 to 5.0 kg (5.5 to 11 lb) and is 40 to 54 cm (16 to 21 in) long with a 25-to-30 cm-long (9.8-to-12 in) tail, which is quite short for a macropod. It has a stocky build, well developed hind legs, rounded ears, and a short, broad head. Its musculoskeletal system was originally adapted for terrestrial bipedal saltation, but over its evolution, its system has been built for arboreal locomotion.[7] Although looking rather like a very small kangaroo, it can climb small trees and shrubs up to 1.5 metres (4 ft 11 in).[8] Its coarse fur is a grizzled brown colour, fading to buff underneath. The quokka is known to live for an average of 10 years.[9] Quokkas are nocturnal animals; they sleep during the day in Acanthocarpus preissii, using the plants\' spikes for protection and hiding.[10]\r\n\r\nQuokkas have a promiscuous mating system.[11] After a month of gestation, females give birth to a single baby called a joey. Females can give birth twice a year and produce about 17 joeys during their lifespan.[9] The joey lives in its mother\'s pouch for six months. Once it leaves the pouch, the joey relies on its mother for milk for two more months and is fully weaned around eight months after birth.[9] Females sexually mature after roughly 18 months.[12] When a female quokka with a joey in her pouch is pursued by a predator, she may drop her baby onto the ground; the joey produces noises which may serve to attract the predator\'s attention, while the mother escapes.[13]');
INSERT INTO `animal` (`id`, `name`, `image`, `content`) VALUES
(19, 'Zebra', , 'Zebras (US: /ˈziːbrəz/, UK: /ˈzɛbrəz, ˈziː-/)[1] (subgenus Hippotigris) are African equines with distinctive black-and-white striped coats. There are three living species: the Grévy\'s zebra (Equus grevyi), plains zebra (E. quagga), and the mountain zebra (E. zebra). Zebras share the genus Equus with horses and asses, the three groups being the only living members of the family Equidae. Zebra stripes come in different patterns, unique to each individual. Several theories have been proposed for the function of these stripes, with most evidence supporting them as a deterrent for biting flies. Zebras inhabit eastern and southern Africa and can be found in a variety of habitats such as savannahs, grasslands, woodlands, shrublands, and mountainous areas.\r\n\r\nZebras are primarily grazers and can subsist on lower-quality vegetation. They are preyed on mainly by lions, and typically flee when threatened but also bite and kick. Zebra species differ in social behaviour, with plains and mountain zebra living in stable harems consisting of an adult male or stallion, several adult females or mares, and their young or foals; while Grévy\'s zebra live alone or in loosely associated herds. In harem-holding species, adult females mate only with their harem stallion, while male Grévy\'s zebras establish territories which attract females and the species is promiscuous. Zebras communicate with various vocalisations, body postures and facial expressions. Social grooming strengthens social bonds in plains and mountain zebras.');
